import React from "react";
import { Tile } from "../tile/Tile";



export const TileList = (props) => {
  const { tiles } = props;

  return (
    <div>
      {
        tiles.map((tile, index) =>
        <Tile 
        contact={contact}
        index={index}
        key={`tile-${index}`}
        />)
      }
      
    </div>
  );
};
